import Reacts from 'react';
import Menu from './Menu';
import TextyAnim from 'rc-texty';

function Contact() {
  return(
    <div className="contact">
      <Menu/>
      <div className = "aboutText">
        <TextyAnim type="swing" onEnd={(type) => {console.log(type);}}>
          CONTACT
        </TextyAnim>
      </div>
    </div>

  )
}

export default Contact;
